import React from 'react';
import Link from 'react-router-dom';

function Navbar(props){

    return (
        <nav>
            <ul className="user">
                <li><Link to={'/'}>Home</Link></li>
                <li><Link to>Favoritos</Link></li>
            </ul>
        </nav>
    )
}

export default Navbar
